            	self.dec.mem1.data(self_next.dec.mem1.write_address) <= self_next.dec.mem1.write_value;
            	self.dec.mem1.read_reg <= self.dec.mem1.data(self_next.dec.mem1.read_address);
            --end if;
        end if;

    end process;
end architecture;